import React, {Component} from 'react';
import Form from "./Form";
import jwtDecode from "jwt-decode";

export default class Contact extends Component {

    render() {
        return (
            <div>
                <br/>
                <br/>
                <p>Do you want to contact the admin?</p>
                <div>
                    <Form/>
                </div>
                <hr/>
                <p>Use the api</p>
                <button onClick={this.getName}>Get my name</button>
                <br/>
                <br/>
                <iframe title="api result"></iframe>
                <hr/>
                <p>Go back to the home page <a href="/">Click here</a></p>
                <button onClick={this.props.auth.logout}>Logout</button>
            </div>

        )
    }
    getName(){
        if(localStorage.getItem("id_token")){
            //return jwtDecode(localStorage.getItem("id_token"));
            console.log(jwtDecode(localStorage.getItem("id_token")).given_name);
        } else{
            return {};
        }
    }
}
